INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (271581267138,'Nash Cling On - Full Range Available',384,'SY82BX','Verenigd Koninkrijk','GB','jmctackle','2.59','GBP','Nieuw: Overige (zie details)','img271581267138.jpg','<div align="center"><font color="#002CFD" size="6">&nbsp;<strong style="background-color: rgba(255, 255, 255, 0);"> Pay one Postage when purchasing more than one item from our Shop</strong></font></div><div style="text-align: start;" align="center"><strong style="background-color: rgba(255, 255, 255, 0);"></strong><font color="#998402"><br></font><div align="center"><b><font color="#998402" size="6">Nash Cling-On Range</font></b></div></div><div align="center"><h3 class="product"><font size="4"><a href="http://www.ericsangling.co.uk/fishing/Nash-Clingers-Diffusion-Camo.html" target="_self">Nash Clingers Diffusion Camo</a></font></h3></div><div align="center"><font size="5">Multi purpose sliding rig stops.<br><br>Clingers
 have almost unlimited uses in modern rigs and end tackles, making them 
essential in any carp or specialist tackle box. Easily slid on to mono, 
braid or fluorocarbon main line or hooklengths using the diamond eye 
wire mounting Clingers can be used to keep double baits together on the 
hair, trap controllers or floats, or as an anchor point for Cling On 
Putty. Available in Small, Medium and Large to suit all rig and end 
tackle applications. Includes 8 stops per packet.<br><br>Nash Clingers Diffusion Camo Feature: -<br>- Only rig stops using the unique diffusion coloration, near invisible underwater.<br>- Three sizes cater for all rig applications<br>- Grip mainline or hooklinks<br><br></font></div><div align="center"><h3 class="product"><font size="5"><a href="http://www.ericsangling.co.uk/fishing/Nash-Clingers-Tungsten.html" target="_self">Nash Clingers Tungsten</a></font></h3></div><p align="center"><font size="5">Clingers
 are micro–engineered reusable Tungsten rig stops. Once you start using 
them you will wonder how you ever managed without them!<br><br>Bait 
stops, float stops, naked chod, use them for setting up controllers, 
anchor points for rig putty, the list is endless. Clingers come in a 
range of sizes and the tungsten–loaded variation can be used to balance 
or over–weight hook baits, sink main line and add weight wherever it is 
needed.</font></p><div align="center"><font size="5"><br></font></div><div align="center"><h3 class="product"><font size="5"><a href="http://www.ericsangling.co.uk/fishing/Nash-Cling-On-Tungsten-Liquid.html" target="_self">Nash Cling-On Tungsten Liquid</a></font></h3></div><p align="center"><font size="5">Brush on, air cure liquid tungsten for the most advanced rig refinements yet possible.<br><br>Fast
 drying liquid tungsten that can be applied to hooks, shot, links, 
leaders and main lines, Cling On Liquid Tungsten provides a world of 
possibilities for rig and end tackle refinements. Brushed on and 
typically dry in less than a minute dependant upon air temperature Cling
 On Liquid Tungsten can be applied at intervals to drop links and main 
line flush to the lake bed, layered over Clinger rig stops or putty to 
balance pop-ups more securely than ever or even brushed direct on to 
hooks to weight points for fast turning or to sit hooks perfectly 
underneath hookbaits. Cling On Liquid Tungsten features a matt green 
finish to blend into any background, with each brushed aluminium bottle 
containing 16ml of Liquid Tungsten. Endless uses for the clued up 
carper!<br><br>Nash Cling-On Tungsten Liquid Features: -<br>- Unique to Nash,<br>- Quick drying,<br>- Clings to hooklink better than any putty or weight,<br>- Less bulky and prone to tangles than any putty or weight,<br>- Paint brush application opens up hundreds of uses, hooks, hairs, lines, hooklinks etc etc.<br>- Scentless once dried</font></p><div align="center"><h3 class="product"><font size="5"><a href="http://www.ericsangling.co.uk/fishing/Nash-Cling-On-Tungsten-Tube.html" target="_self">Nash Cling-On Tungsten Tube</a></font></h3></div><p align="center"><font size="5">Ultra-supple fast sinking tungsten impregnated anti-tangle tubing for improved rig concealment.<br><br>A
 real edge for the dedicated, thinking carp angler Cling On Tungsten 
Tube nails the rig down over humps and bumps, bars and even amongst 
areas of weed. Fish slack-line style and Cling On Tungsten Tube will 
take up the contours of the lakebed to help your trap disappear amongst 
tackle conscious carp. Its weight enhances bolt effect too.<br><br>For easy threading of mainline we recommend the Nash Tube Threader.<br><br>Two metres per pack, 0.75mm internal bore.</font></p><div><div align="center"><h3 class="product"><font size="5"><a href="http://www.ericsangling.co.uk/fishing/Nash-Cling-On-Leader.html" target="_self">Nash Cling-On Leader</a></font></h3></div><p align="center"><font size="5">Super supple, contours and clings to any lakebed feature. Ultra Heavy – the space age alternative to lead core.<br><br>Using
 the latest cutting edge braiding technology we are delighted to 
announce the launch of the fastest sinking and most supple leader 
materials known to carp angling!  <br><br>Braided from extremely heavy 
PTFE fibers and Dyneema, Cling-On leader material provides maximum 
abrasion resistance whilst clinging tight to the lake bed out of sight.</font></p><div align="center"><h3 class="product"><font size="5"><a href="http://www.ericsangling.co.uk/fishing/Nash-Cling-On-Tungsten-Putty.html" target="_self">Nash Cling-On Tungsten Putty</a></font></h3></div><p align="center"><font size="5">Nash
 Cling-On Tungsten Putty is a maximum adhesive rig putty which has been 
hailed as the stickiest the carp world has ever seen. <br><br>Nash Cling-On Tungsten Putty is perfect for balancing hookbaits, holding down pop-ups or pinning down your end tackle. <br><br>Nash Cling-On Tungsten Putty is available in three camouflaged colours:<br>Weed<br>Gravel<br>Silt</font></p><div align="center"><font face="Arial, Helvetica, sans-serif" size="5"><font face="Arial, Helvetica, sans-serif">For more information or to make a card payment call us on the number listed below</font></font><br></div><p align="center"><font face="Arial, Helvetica, sans-serif" size="2"><font face="Arial, Helvetica, sans-serif" size="2"><font size="6"><font size="5">or for a amazing price on any other items Fishing Tackle you require. </font><br><br>Tel: 01584 856387</font></font></font></p><p align="center"><font face="Arial, Helvetica, sans-serif" size="2"><font face="Arial, Helvetica, sans-serif" size="2"><br><br><font size="5">Or make appointment to come and see us and collect your items </font><br></font></font></p><p align="center"><font face="Arial" size="5">UK Postage Only</font></p><p align="center"><font face="Arial" size="5">Orders will be dispatched Monday to Friday excluding bank holidays.&nbsp; <br></font><font face="Arial" size="5"><font face="Arial"><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;"></span></span></font></font></em></font></font></p><p style="margin-bottom: 0.5cm;" align="center"><font face="Arial" size="5"><font face="Arial"><em><font color="#333333"><font face="Arial, sans-serif"><b><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;">Postage is for England, Wales and Scottish Lowlands only.</span></span></font></font></em></b></font></font></em></font></font></p><p style="margin-bottom: 0.5cm;" align="center"><font face="Arial" size="5"><font face="Arial"><em><font color="#333333"><font face="Arial, sans-serif"><b><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;">Customers
 from</span></span></font></font></em><font face="Arial"><font face="Arial"><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;"><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;"> Isle Of Wight,</span></span></font></font></em></span></span></font></font></em></font></font><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;"> Scottish Mainland, Scottish Offshore, Isle of Man 
&amp; Ireland - Please get in contact with us before placing 
your order </span></span></font></font></em><em><font color="#333333"><font face="Arial, sans-serif"><span style="font-style: normal;"><span style="text-decoration: none;">as price will be subject to surcharge.</span></span></font></font></em></b></font></font></em></font></font></p><p><br></p></div>')
