<![endif]--><b style=""><span style="font-size: 26pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: black;" lang="EN-GB">Fluff Chucking for
the Masses</span></b><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: black;" lang="EN-GB"><br><br>ISBN </span><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: black;">978-0-9565261-5-1</span>



<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal;"><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: black;" lang="EN-GB">The complete beginner’s guide to fly fishing for game, coarse and sea fish</span></p><div style="text-align: left;"><br style="font-family: Times;"></div><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB">The days of tweed clad aristo’s stalking the banks of
exclusive chalk streams and salmon beats are all but past. Now, anyone with a
fly rod and the price of a day ticket can enjoy outstanding sport at the many
commercial fisheries to be found throughout the UK.</span></font></p><div style="text-align: left;">



</div><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB">Nor is the budding fly fisher’s quarry restricted to
game fish such as trout, salmon and grayling: sea and coarse anglers too have
begun trading floats for flies – in pursuit of pike, carp, mullet, bass and numerous
other species.</span></font></p><div style="text-align: left;">

<font size="3"><span style="font-family: Times;"></span></font><font size="3"><span style="font-family: Times;"></span></font><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB"><span style="font-family: Times;"><br></span>Whether you are an
accomplished match or specimen angler looking to try something new - or you’ve
never caught a fish in your life - <b style="">you
owe it to yourself to give fly fishing (aka ‘fluff chucking’) a try</b>.</span></font></div><div style="text-align: left;">



</div><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB">Contrary to popular belief, fly fishing is not especially
complex; in fact it reduces the sport of angling to its basics: a rod, reel,
line and a baited hook.</span></font></p><div style="text-align: left;">



</div><div style="text-align: left;">



</div><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB">There is no place in the fly fisher’s armoury for
sophisticated self-hooking rigs and electronic bite alarms. Rather, the
successful fly fisher actively stalks his prey – applying a unique
understanding of his quarry, its habits and habitat to present the right fly,
in the right place, at precisely the right time.</span></font></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB"><span style="font-weight: bold;">Fluff Chucking for the Masses introduces the tackle and techniques you’ll need to make your first successful foray into fly fishing.</span><br>Included, you’ll find clear, jargon free advice on<br>selecting the right fly rod, reel and other tackle - on a realistic budget<br>understanding the different types of fly line, leaders and tippets<br>unwhen and where to use wet flies, dry flies and nymphs<br>where to buy flies for carp, pike and sea fishing<br>choosing the right venue<br>casting and mending your line<br>watercraft and fish spotting<br>fish care<br>and much more besides<br><br><span style="font-weight: bold;">New from the publishers of The Bluffer’s Guide to Carp Fishing, and The Quest For Big Cats, this eminently readable ebook also reveals:</span><br><br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10 ‘go to’ flies that work anytime and (almost) anywhere<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the benefits of fly tying versus buying <br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 12 casting tips to help you ‘go the distance’<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3 essential fly fishing knots and how to tie them<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; how to ‘match the hatch’<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; why sometimes it’s enough ‘just being there’ – at one with the natural environment<br><br>Most importantly of all, Fluff Chucking for the Masses goes a long way to explaining the perennial appeal of fly fishing, sharing the joys, frustrations and - ultimately – sheer exhilaration that regular fly fishers experience (almost) every trip out.<br><br><span style="font-weight: bold;">You can order Fluff Chucking for the Masses in total confidence</span><br>This invaluable guide for fly fishing newcomers is backed by our usual no quibble money back guarantee:<br>In the unlikely event that you’re not 100% satisfied with your purchase simply email info@stevecalder.com. We’ll refund the cover price in full.<br><br><span style="font-weight: bold;">And we guarantee something else, too:</span><br>When you finally lean into your first fly-hooked trout or pike, carp, bass, or even salmon… you’ll wish you’d discovered this most addictive and enthralling of sports years ago.<br><br>So why waste any more time?</span></font></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; font-family: Times; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB">Order Fluff Chucking for the Masses on CD now<br><br>Just £4.95 - POST FREE<br><br>&nbsp;<br><br>Order now<br><br></span></font></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; text-align: left;"><font size="3"><span style="font-size: 12pt; color: black;" lang="EN-GB"></span><b style=""><span style="font-size: 16pt; color: black;" lang="EN-GB"></span></b><br><span style="font-size: 12pt; font-family: Times; color: black; background: none repeat scroll 0% 0% yellow;" lang="EN-GB"></span></font><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: black;" lang="EN-GB"></span></p>

