INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (300672956600,'Fishing Scissor Pliers Tool 8 Functions stainless steel',384,'SA129LQ','Verenigd Koninkrijk','GB','smflyman','2.99','GBP','Nieuw','img300672956600.jpg','<font face="Arial" size="5">The return of our most popular tool.</font><div><font face="Arial" size="5">This useful tool has:</font></div><div><font face="Arial" size="5">A pair of textured jaws to grip</font></div><div><font face="Arial" size="5">Matching indents to close shot</font></div><div><font face="Arial" size="5">A good sharp scissor action with serrated blade for line grip</font></div><div><font face="Arial" size="5">A wire stripping groove in the scissor jaws</font></div><div><font face="Arial" size="5">A wire cutting shears below the rivet</font></div><div><font face="Arial" size="5">A tool for opening celebratory bottles</font></div><div><font face="Arial" size="5">A flat screwdriver blade</font></div><div><font face="Arial" size="5">A shot splitter edge</font></div><div><font face="Arial" size="5">Very useful to have in your bag or on a lanyard.</font></div><div>Please have a look at my other items. I aim for your positive feedback. If you feel I dont deserve it please email me so I can right any problem.
If buying several items please ask for an invoice using the REQUEST A TOTAL button so I can make the postage correct.
If you change your mind and return an item in re-saleable condition I will exchange it or refund the original price of the item. Obviously the buyer must pay the postages.
If an item is faulty I will replace or refund and I will pay postage.
8 or more items are post free in the UK only.
Sign up for my newsletter when you add me to your favourites. You will get notification of reduced prices whenever there is a sale. There is a draw for fly tying prizes. All newsletter signees are entered automatically every month.</div>')
