INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (300825070969,'Avid End Terminal Tackle - Complete Range Available',384,'TN240HG','Verenigd Koninkrijk','GB','invictaangling','3.5','GBP','Nieuw','img300825070969.jpg','<p align="center"><font size="5" face="Arial"><u><strong>Avid Terminal Tackle Complete Range</strong></u></font></p>
<h1 align="center"><font size="4" face="Arial"><u>Flat Clip</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Speed fishermen and PVA stick lovers everywhere are going to love this product. It’s a lead clip that houses a Speed Link, rather than a swivel. Simple, but effective.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Lead clip designed for use with quick-change SPEEDLINKS to make rig changes fasterthan ever before. By using loop knots at the end of your rigs, you can swap hooklengths easily and effectively</strong></font></p><font size="2"><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Chod Buffers</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Covers the lead on Chod and Helicopter rigs. Colour matched to blend in on all lakebeds. Compatible with size 8 swivels. Can also be used with Avid Speed Links <br>Perfect for covering the lead on your helicopter and Chod rigs. They are also useful as a buffer bead for a highly effective running rig. Can also be used for marker float setups.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Speed Link</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Designed for use with the Avid Carp Flat Clip, these Speed Links have a dull, matt finishthat’s in-keeping with the rest of our highly camouflaged terminal tackle range.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>The Avid Carp Flat Clip, enables anglers to change rigs quickly and effectively. They have a multitude of uses and can be used for anything that needs to be attached or removed with minimum fuss, like leads, marker floatsand spods.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Tube Gripper Clip</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Anglers have suffered with their tungsten tubing sliding up the line out of their tailrubbers for years.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>We’ve designed the Tube Gripper Clip to combat this problem, gripping the tubing when closed, preventing it from pulling out andsliding up the line.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><u><strong>PVA Metal Link</strong></u></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Tangles are feared by every carp angler, so we’ve designed a product for mesh PVA bag fishing that avoids this problem. Simply attach the PVA Metal Link to your lead, slide on a PVA bag and hook in your rig. Done!</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Chod Bead</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>The Chod Rig is one of the most popular presentations in use today. We’ve invented a bead that allows anglers to use this setup on leadcore or directly on their main line. It’s safe, easy to use and very inconspicuous on the lakebed.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>To help thread them on they come supplied on wires. If you are using leadcore or fluorocarbon leaders just thread the Chod Bead down onto your leader before tying to your main line. If you’re fishing the naked chod directly on to your main line, just take the bead off the wire and thread using a small baiting needle.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Drop-Off Stem</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>A purpose made item that when used with anAvid Groove Lead produces the perfect drop-off setup.<br>Drop-Off in-line setups are a popular but technical method of attaching the lead when fishing in weedy lakes. Attach both leader/main line to the same ring as your hooklink then insert into the Avid In-line Groove lead long or short insert.<br>Once a take occurs the stem will easily come free from the insert allowing the lead to drop away from the tail rubber ensuring you stay in contact with the fish and not risking the lead getting caught in the weed.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>In-Line Inserts</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>IN-LINE INSERTS are designed to work with the Avid Carp lead range. They are available in two different lengths to suit different angler’s requirements.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Tail Rubbers</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Avid Carp TAIL RUBBERS are designed to be used in conjunction with a number of products in the terminal tackle range, like our leadclipsand in-line leads. The soft rubber tails will neaten and streamline your setup.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Swivels</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>No setup would be complete without a SWIVEL. It has the main connection between you and the fish and therefore needs to be as reliable as possible. We‚have sourced the strongest, low-glare swivels we could find, that fit with just about everything in the Avid Carp terminal tackle range.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Flying Chod Beads</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>The first bead designed for the flying<br>Chod rig<br>• Colour matched to blend in on all lakebeds • GRIP STOP bead to semi-fix your rig anywhere on the line • Ultra-safe rubber BEAD will pass over all leader knots<br>These rubber FLYING CHOD BEADS are an excellent way to setup the popular naked Chod rig or when using any Helicopter setup direct onto your main line. The two part construction includes a GRIP STOP and rubber BEAD, so it’s ultra safe.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><u><strong>Zig Clips</strong></u></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Unique PVA tape retaining tag<br>Perfect for Zig rig fishing and long range casting<br>Compatible with size 8 swivels<br>Colour matched to blend in on all lakebeds<br>Possibly the safest leadclips on the market.<br>A unique plastic tag system on the barrel means you can whip PVA tape around the clip and merely pinch it under the tag to secure it. <br>This means you can use the clip without a tailrubber when required, perfect for Zig fishing or fishing in heavy weed.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><u><strong>Stopper Beads</strong></u></font></p><font size="4">
</font><h3 align="center"><font size="4" face="Arial">Versatile, tightly gripping beads</font></h3><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Super soft material for added safety when using leader knots • 6mm in diameter to suit Avid Carp Ring Swivels • Colour matched to blend in on all lakebeds<br>Small bore hole for added grip on lines and leadcore<br>STOPPER BEADS are ideal for Helicopter rigs, running rigs and shocker rigs. The tiny bore through the centre means they grip heavy line and leadcore brilliantly, but the soft material means they are still extremely safe.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><u><strong>Weighted Flying Chod beads</strong></u></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Pin down your flying Chod rigs<br>GRIP STOP bead to semi-fix your rig anywhere on the line<br>Ultra-safe WEIGHTED BEAD will pass over all leader knots<br>Colour matched to blend in on all lakebeds</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>These weighted FLYING CHOD BEADS are an excellent way to setup the popular naked Chod rig or when using any Helicopter setup direct onto your main line. The two part construction includes a GRIP STOP and WEIGHTED BEAD, so it’s ultra safe. Each individual packed contains 16 Grip Stops &amp; 9 Weighted Beads.</strong></font></p><p align="center"><font size="4" face="Arial"><u><strong>Ring Swivels</strong></u></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Low-glare anti-spook finish<br>Compatible with Avid Carp Chod Beads <br>Available in size 8 and 11.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Give your rigs maximum movement. We’ve sourced the strongest, low-glare swivels for a secure connection. Great for Chod rigs and Helicopter presentations.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><u><strong>Clip Pegs</strong></u></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Colour matched to blend in on all lakebeds<br>Compatible with Avid Carp lead clip systems<br>Fits neatly in your tackle box<br>CLIP-PEGS are spare pins that fit the Avid Carp Flat clips, Tube Gripper clips and Zig clips Just in case you lose a few!</strong></font></p><p align="center"><strong><font size="4" face="Arial"><u>Inline Run Beads</u></font><font size="4">
</font></strong></p><p align="center"><font size="4" face="Arial"><strong>For safe in-line lead running rigs<br>Colour matched to blend in on all lakebeds<br>Fits neatly and safely inside Avid Carp In-Line leads<br>Complete with Avid Carp Speed Links<br>Designed so you can use a running in-line lead in conjunction with quick-change Speed Links to make rig changes faster than ever. By using loop knots at the end of your rigs, you can swap hooklengths easily and effectively.</strong></font></p><font size="4">
</font><h1 align="center"><font size="4" face="Arial"><u>Marker Elastic</u></font></h1><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>Fish with more accuracy<br>Available in fluorescent green and orange<br>Fits neatly in your tackle box<br>Grips line like no other elastic</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>A bespoke, slimline elastic designed specifically for marking your line. This way, you can fish to your spots accurately every time.</strong></font></p><p align="center"><font size="4" face="Arial"><u><strong>Tube Gripper Inline Inserts</strong></u></font><font size="4">
</font></p><p align="center"><font size="4" face="Arial"><strong>Holds tubing in place<br>Colour matched to blend in on all lakebeds<br>Grips Avid Carp Thread &amp; Go Tungsten Tubing<br>Designed for use with Avid Carp in-line leads<br>Compatible with size 8 swivels<br>Designed to prevent common problems when using sinking rig tubing.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong>The INSERT grips the tubing when used inside an in-line lead, preventing it from pulling out and sliding up the line.</strong></font></p><font size="4">
</font><p align="center"><font size="4" face="Arial"><strong><u>Naked Chod Bead</u></strong></font></p><font size="4">
