  <div style="padding-right:20px; float:right; width:270px;"><b style="color: #000;">Top-Features :</b> <br />
  <ul><li>détecteur de poissons avec sonar</li><li>jusqu''à 100 mètres de profondeur</li><li>adapté à l''utilisation à la pêche nocturne et à la pêche sous la glace</li></ul></div>
