  <!--Beschreibung-->
  <div class="fliesstext" style="border-bottom: 1px solid #ccc; width:690px; float:left;"> <b style="color: #000; font-size: 16px; line-height: 2;">Description</b> </div>
  <div id="content"> <span style="text-align: justify;">
	<div style="font-weight: bold;"><p>Détecteur de poissons avec sonar avec une profondeur jusqu''à 100 mètres, mesure exacte et continue et écran LCD expressif.</p><p>Adapté à la pêche nocturne et sous la glace. Adapté aux fleuves, étangs et lacs-</p><p>Adapté au montage sur un bateau ou sur la canne à pêche.</p></div>
	<p>Le <strong>détecteur de poissons Electronic-Star</strong> est un <strong>appareil de localisation de poissons</strong> qui cherche vos plats principaux jusqu''à une profondeur de 100 mètres et sous un angle de 45°.</p><p>Un<strong> écholot</strong> représente l''élément principal de cet appareil qui transmet ses résultats à l''unité centrale par un câble de 8 mètres de long. Celui-ci représente clairement les informations recueillies sur un écran de 5cm qui informe sur l''emplacement et la profondeur des poissons ainsi que sur le relief. Un signal acoustique optionnel vous informe lorsque un poisson entre dans la zone surveillée. À l''aide de la sensibilité ajustable à deux niveaux, les petits poissons peuvent être masqués pour vous concentrer sur les grandes prises.</p><p>Le <strong>détecteur de poissons Electronic-Star</strong> approche sa tâche avec beaucoup de plaisir sous toutes sortes de conditions. Lors de mauvaise visibilité ou lors de la <strong>pêche nocturne</strong>, vous pouvez allumer le rétro-éclairage qui reste éteint en mode normal pour économiser de l''energie. En outre l''appareil est disposé à fonctionner à des températures jusqu''à -20°C pour ainsi fonctionner même pour la<strong> pêche sous la glace</strong>.</p><p>À l''aide du matériel de montage inclus dans le lot, <strong>Echolot</strong> peut être monté au bas d''un bateau. Il peut également être utilisé en mode mains-libres ou avec une canne à pêche.</p><p>Le design de ce produit est disposé à ne pas surcharger les boîtes de pêche et à resister au mauvais temps.</p></span>
    <p>&nbsp;</p>
    <b style="color: #000;">Top-Features :</b><br />
    <ul><li>détecteur de poissons avec sonar pour fleuves, étangs et lacs</li><li>jusqu''à 100 mètres de profondeur et un angle de 45°</li><li>écran 5cm informatif, clair et anti-reflets pour afficher l''emplacement et la profondeur des poissons ainsi que le relief et les plantes aquatiques</li><li>adapté à l''utilisation à la pêche nocturne, rétroéclairage LCD vert optionnel</li><li>adapté à la pêche sous la glace - utilisable aux températures entre -20° et 70°</li><li>boîtier maniable, adapté à l''utilisation à l''extérieur et imperméable aux éclaboussures</li><li>dimensions maniables - va dans chaque boîtier de pêche ou dans chaque sac-à-dos</li><li>adapté au montage sur un bateau ou sur une pêche</li></ul> <b style="color: #000;"> <br />
    Caractéristiques:</b><br />
    <ul><li>alarme sonore optionnelle lorsqu''un poisson est localisé</li><li>mise à jour des résultats chaque seconde</li><li>sensibilité ajustable (2 niveaux)</li><li>indique les plantes aquatiques (3 niveaux)</li><li>indique le relief (3 niveaux)</li><li>flotteur jaune amovible</li><li>indique la profondeur en mètres ou en pieds</li><li>rétro-éclairage LCD optionnel</li><li>mode économisation d''énergie</li><li>affiche le chargement de la batterie</li><li>profondeur de scan minimum: 0,7 mètres</li><li>mode simulation</li><li>alimentation: 4 x pile AAA (non-incluses dans le lot)</li><li>alimentation Echolot: par l''unité centrale</li></ul> <b style="color: #000;"> <br />
    Inclus dans la livraison :</b><br />
    <ul><li>1 x unité centrale</li><li>1 x sonar avec câble et flotteur</li><li>1 x dragonne</li><li>matériel de montage pour sonar (boulon et écrou papillon)</li></ul> <b style="color: #000;"> <br />
    Dimensions:</b><br />
    <ul><li>7 x 12 x 3cm (LxHxP)</li><li>longueur du cable: 8 mètres environ</li><li>poids unité centrale: 132g</li><li>poids senseur: 120g</li></ul> </div>        
    
