<p class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Alle voorwerpen worden zorgvuldig ingepakt om mogelijke beschadigingen door derden tijdens het transport te voorkomen.</span></p>
<p class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Gecombineerde verzending is mogelijk.</span></p>
<p class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Voorwerpen
 dienen opgehaald te worden binnen de 7 dagen na verkoop. Ophaling 
gebeurt na afspraak. Ophaling is mogelijk op alle dagen met uitzondering
 van zondag. De verkoper behoudt zich het recht om een stockagekost van 
minimaal 25euro/maand aan te rekenen bij overschrijding van de termijn 
van 7 dagen.</span></p>
<p class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Voor vragen kan u mij steeds contacteren op het nummer 0472/381.285</span></p>
<p class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">&nbsp;</span><span class="hps"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR">Les paiements doivent être</span></span><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"> <span class="hps">effectués dans les 5</span> <span class="hps">jours.</span></span></p>
<p class="MsoNormal"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"><span class="hps">Acheteurs</span> <span class="hps">belges et européennes</span> <span class="hps">payent par virement bancaire</span></span></p>
<p class="MsoNormal"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"><span class="hps">Le coût de</span> <span class="hps">livraison comprennent:</span> <span class="hps">le coût d''expédition</span> <span class="hps">(</span>Bpost), l''emballage et <span class="hps">du travail</span>. <span class="hps">L’expédition est</span> <span class="hps">un service supplémentaire</span> <span class="hps">que nous offrons</span> prix de coût. <span class="hps">Collection</span> <span class="hps">est gratuit.</span> <span class="hps">Vous avez le choix</span>.</span></p>
<p class="MsoNormal"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"><span class="hps">Tous les</span> <span class="hps">articles sont soigneusement emballés</span> <span class="hps">pour éviter tout risque</span> <span class="hps">dommages de tiers</span> <span class="hps">pendant le transit</span>.</span></p>
<p class="MsoNormal"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"><span class="hps">Transport combiné</span> <span class="hps">est disponible</span>.</span></p>
<p class="MsoNormal"><span style="COLOR: #76923c; mso-themecolor: accent3; mso-themeshade: 191; mso-ansi-language: FR" lang="FR"><span class="hps">Les objets doivent</span> <span class="hps">être ramassés</span> <span class="hps">dans les 7</span> <span class="hps">jours suivant la vente</span>. <span class="hps">Collection</span> <span class="hps">se fait</span> <span class="hps">sur ​​rendez-vous</span>. <span class="hps">Collection</span> <span class="hps">est disponible sur</span> <span class="hps">tous les jours</span> <span class="hps">sauf le dimanche</span>. <span class="hps">Le vendeur</span> <span class="hps">se réserve le droit</span> <span class="hps">à des frais de</span> <span class="hps">stockage d''au moins</span> <span class="hps">25euro/mois</span> <span class="hps">de facturer</span> <span class="hps">de dépassement du délai</span> <span class="hps">de 7 jours</span>.</span></p>
