<p style="LINE-HEIGHT: normal; MARGIN-BOTTOM: 0pt" class="MsoNormal"><span style="LINE-HEIGHT: 115%; FONT-FAMILY: ''Times New Roman'',''serif''; COLOR: brown; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE; mso-ansi-language: FR-BE" lang="FR-BE">&nbsp;</span><span style="FONT-FAMILY: ''Times New Roman'',''serif''; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Payments must be made within 5 days.</span></p>
<p style="LINE-HEIGHT: normal; MARGIN-BOTTOM: 0pt" class="MsoNormal"><span style="FONT-FAMILY: ''Times New Roman'',''serif''; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Belgian and European buyers pay by bank transfer</span></p>
<p style="LINE-HEIGHT: normal; MARGIN-BOTTOM: 0pt" class="MsoNormal"><span style="FONT-FAMILY: ''Times New Roman'',''serif''; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">The
 cost of shipping include: the shipping cost (Bpost), packaging and 
labor. Shipping is an extra service we provide at cost. Pickup is free. 
