<p style="LINE-HEIGHT: normal; MARGIN-BOTTOM: 0pt" class="MsoNormal"><span style="FONT-FAMILY: ''Times New Roman'',''serif''; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Combined shipping is available.</span></p>
<p style="LINE-HEIGHT: normal; MARGIN-BOTTOM: 0pt" class="MsoNormal"><span style="FONT-FAMILY: ''Times New Roman'',''serif''; FONT-SIZE: 12pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: NL-BE">Objects must be picked up within 7 days of sale. Collection is done by appointment. </span></p>
