<h1><font color="blue"><u></u></font>
<center><font color="blue"><u><font size="4">*** NOUVEAU Convertisseur-inverseur automatique haute qualité 12v en 220volt, 200W avec pic de 500 watt ! prix en magasin spécialisé : 89,99 euro***</font><br></u><font size="4"><span style="color: rgb(0, 184, 239);">Egalement disponible en modèle 350 WATT (max 700 Watt), avec raccordement direct pour pince sur batterie, au même prix de vente.</span></font><br style="color: rgb(0, 184, 239);"><font style="color: rgb(0, 184, 239);" size="4">(le raccordement allume-cigare est possible pour une puissace de maximum 200 WATT, au delà, le risque est grand de faire sauter les fusibles, il est donc nécessaire d''utiliser un raccordement directement sur la batterie pour des puissances supérieures à 200 Watt ( pic de puissance max 400 Watt)</font><u><br><font size="3"><br></font></u><font size="3"><span style="font-weight: normal;">Avec ce transformateur&nbsp; 200 Watt de tension ils peuvent pouvoir attacher agréablement directement normale 220V des appareils électriques dans les voitures/bateaux/caravane/caravane avec à 12V une batterie sur la pince de serrage fournie . la puissance continue de l''appareil est 200 watts, sur des temps courts est aussi possible pour 700 watts.</span><br style="font-weight: normal;"><span style="font-weight: normal;">L''électronique intelligente fait mettre l''appareil hors circuit lors à d''une faible tension de batterie, c.-à-d. que pour elle vous n''êtes vidé jamais la batterie de voiture, de sorte que vous ne pourriez plus démarrer votre voiture.</span><br style="font-weight: normal;"><font style="font-weight: normal;" size="4">Modèle idéalement de manière appropriée pour des lap-tops, des chargeurs de batterie ou de mobilophone, des consoles de jeu etc..</font><br style="font-weight: normal;"><span style="font-weight: normal;">Combien la performance devrait avoir le transformateur de tension :</span><br style="font-weight: normal;"><span style="font-weight: normal;">Tous les appareils frigorifiques, postes de télévision, Monitore, Notebooks, pompes, des machines-outils et beaucoup d''autres appareils inductifs ont une électricité de démarrage à court terme extrêmement élevée. Si vous choisissez ainsi un transformateur pour ces appareils, vous devriez absolument respecter sur cela. Si p. ex.</span><br style="font-weight: normal;"><span style="font-weight: normal;">sur votre TV- une performance de 150 watts est indiquée, l''électricité de démarrage jusqu''à la performance peut s''élever à 10x : Cela signifierait que vous devriez choisir un inverseur qui à </span><font style="font-weight: normal;" size="5">court terme</font><span style="font-weight: normal;"> 1500 watts performance peuvent accepter !&nbsp; tenez compte ainsi absolument de ce facteur important ! Il arrive toujours à nouveau que des clients pour des raisons de prix choisissent à des inverseurs mesurés faiblement et ont ensuite de grands problèmes lorsque le modèle trop faible est détruit pour l''entreprise. Cela arrive aussi souvent avec des chargeurs inductifs (p. ex. pour des machines-outils).</span><br style="font-weight: normal;"><span style="font-weight: normal;">Si l''étiquette de votre appareil électrique n''indique pas de performance de watt, vous les ampères (a) connaissez toutefois, pouvez vous calculer la performance de watt : Ampère (a) x volt (V) = watt</span><br style="font-weight: normal;"><span style="font-weight: normal;">Exemple : 3 Ampères x 220 volts = 660 watts ou 3 ampères x 110 volts = 330 watts comprennent à cette valeur déterminée vous encore 20-30% réserve et choisissent alors le transformateur correspondant, p. ex. 330 watts + 20% = 396 watts . Ainsi vous devriez commander un transformateur avec 400 watts </span><br style="font-weight: normal;"><span style="font-weight: normal;">Veuillez ne pas commander un transformateur trop faible pour votre appareil , vous risqueriez fortement d''endommager votre appareil ou le transformateur. Modèles plus puissant jusque 5000 Watt sur demande.</span></font></font></center></h1></center>
