aalde waarde u nog 20-30% reserveren en kiezen dan de overeenkomstige transformator, bvb. 330 watts + 20% = 396 watts. Aldus zou u een transformator met 400 watts moeten bestellen gelieve geen enkel voor het apparaat de geringe transformator ervan te bestellen, aangezien dat transformators zou kunnen beschadigen en het vastgemaakte apparaat.<br>Technische gegevens<br>De macht van output op duurzame wijze: 200Watt ( korte termijn 400watt) de spanning van toegang: 10~15V de eerste spanning: 220V, 50Hz alarmeert bij een geringe spanning van batterij: 10,5 +/- 0,5V de snijwond tijdens van een geringe spanning van batterij: 10 +/- 0,5V de efficiëntie: 85~90% masseert inwisselbare 20A garantie: 17 x 12,5 x 5,2 alarmeert cm bescherming van oververhitting tijdens van de geringe spanning van batterij bescherming tegen overspanning van toegang bescherming van overbelasting van een geringe spanning van gegarandeerde kortsluitingsbatterij het apparaat tijdens zetten worden onderzocht de EG en verwezenlijken alle vereiste veiligheidsniveau''s met een (!) in het oktober 2002 elk elektronisch apparaat voor de auto moet dit kenmerk bezitten! Die die elektrische apparaten in KfZ zonder dit teken gebruikt komt strafbaar tot stand. houdt met dit teken rekening.</font></font><font color="green"><font color="red"><span style="text-decoration: underline;"></span></font></font></font></center></h1>
