<p><center> Field Guide to Fishing Lures is aimed at assisting the beginning, intermediate, and advanced collector and the general antique and collectible dealer in identifying both collectible older vintage lures and the more modern classic fishing lures. It includes a cross-section of both very old and more recent collectible lures and has prices of each lure shown. With the help of this easy-to-tote guide, collectors will be able to recognize all major categories of lures and the most significant companies in the industry while hunting for additions to their collections. The book begins with the six major companies, Creek Chub Bait Company, Heddon, Paw Paw, Pfleuger, Shakespeare, and South Bend. Then an alphabetical listing of more than 200 companies highlights other significant manufacturers and their major contributions. The book continues the tradition of high quality, detailed photographs useful in identifying small nuances important in lure collecting, as well as the author''s practice of providing historical data for readers.
