<P align=left><FONT color=#000000><STRONG><U><FONT color=#ff0000 size=1></FONT></U></STRONG></FONT></P></FONT></SPAN><SPAN><FONT color=#00008b><SPAN class=item-field-value>The Bird &amp; Trout Knife is a modern version of a 100 year old classic, treasured by hunters and fishermen for generations. The secret to its enduring popularity is its ultra slim profile, and unique all steel construction. The skeletonized handle offers great versatility and freedom of movement. It''s perfect for working in tight places or making precise cuts. The ring allows the knife to hang from the little finger when not in use and yet remain instantly available. The Bird &amp; Trout is made out of AUS 8A stainless steel. For safety and handiness, each knife comes with a light weight Concealex neck sheath and steel bead chain lanyard.</SPAN><BR></FONT>
<P><FONT size=1></FONT></P>
<P align=left><FONT size=1></FONT>&nbsp;</P>
<P align=left><STRONG><FONT size=1 face=Verdana><EM><U>Bird and Trout Stainless</U></EM></FONT></STRONG></P>
<P align=left><STRONG><EM><FONT size=1>I am the owner/operator/janitor/book keeper/sole employee of a used book store, and this Cold Steel Bird &amp; Trout Knife has been my daily companion for the last year or so. I use it for opening packages, scraping labels, opening paint cans (with the ring part of the handle), pulling staples, cutting tape and paper -- every job that requires a cutting edge or small pry bar. It is always handy, and during working hours I wear it around my neck with the included necklace sheath. No digging in pockets, no blade-opening procedure, and no fumbling with the sheath; just a quick grab and it is in use.</FONT></EM></STRONG></P>
<P align=left><SPAN><STRONG><EM><FONT size=1>The Bird &amp; Trout Knife is a modern version of a 100 year old classic, treasured by hunters and fishermen for generations. The secret to its enduring popularity is its ultra slim profile, and unique all steel construction. The skeletonized handle offers great versatility and freedom of movement. It''s perfect for working in tight places or making precise cuts. The ring allows the knife to hang from the little finger when not in use and yet remain instantly available. The Bird &amp; Trout is made out of AUS 6A stainless steel. For safety and handiness, each knife comes with a light weight Concealex neck sheath and steel bead chain lanyard.</FONT></EM></STRONG></SPAN></P><SPAN>
