<br></font><font size="5"><font size="5">Closed length</font> 75cm closed<br>Casting weight 10-40g<br>&nbsp;Material Glass<br>&nbsp;Colour Maroon</font></p><p><font size="5">Casing Cloth bag<br><br><font size="6">6 x Pear sinkers<br></font>6 Pear sinkers.<br>Can also be used as plumb line or depth gauge weight <br>&nbsp;easy to use and in a&nbsp; store selection box <br>&nbsp;ideal for all types of sea fishing<br><br><font size="6">&nbsp;Pack of 90 hooks </font><br>&nbsp;Pack of 90 hooks <br>&nbsp;10 assorted sizes <br>&nbsp;Eyed <br>&nbsp;Barbless <br>Stored in a handy tackle box</font><br></p><p><br></p><p><font size="6">Pack of 3 Super Soft Baits</font><br><br></p><p><font size="5">A set of 3 super soft NGT Klone Baits. Ideal for fresh or salt water use.<br>&nbsp;<br>Super Soft<br>Looks And Feels Alive<br>Realistic Feel<br>Realistic Action<br>Brand: <font color="#FF9936">NGT</font><br></font><br><br><font size="5"><font size="6">Pack of 5 ''Fine Tip'' Waggler Floats</font><br><br>A pack of 5 wide or fine tip waggler floats packed on a double blister.<br>&nbsp;Brand: <font color="#FF9936">NGT</font><br></font></p><p><font size="6">1 x 4 Way ''Mini'' NGT Non Toxic Shot<br><br><font size="5">4 way mini non toxic split shot includes No 1, No 4, BB and SSG sizes.<br>&nbsp;<br>Brand: <font color="#FF9936">NGT</font></font></font></p><p><font size="6">1 x Pack Of 10 Hooks To Nylon<br></font></p><p><font size="6"><font size="5">&nbsp;Size may vary from size 8 to 18</font><br></font><br></p><p><img src="data:<;base64," alt=""></p><p><br><br></p></td>
