            <td colspan="3" class="CentreMiddle" align="center"><font size="6" face="Arial"><span style="font-size: 20px;" id="ctl00_ContentPlaceHolder1_dlProducts_ctl07_lblFullName"><font face="Times New Roman"><strong><br></strong></font></span></font><br><p><font size="6">CARP TRAVEL FISHING SET WITH HOLDALL</font></p><p><font size="6">&amp;</font></p><p><font size="6">ACCESSORIES <br></font></p><p><img src="data:<;base64," alt=""></p><p><font size="5"><br></font></p><p><font size="5">CARP TRAVEL FISHING SET WITH HOLDALL <br></font></p><p><font size="5">&amp;</font></p><font size="5">ACCESSORIES </font><p><font size="5"><br></font></p><p><font size="6">1 x Rod Holdall</font><br></p><p><font size="5">An in house custom designed item. A rod holdall / system that is ideal for packing away a travel rod, reel and essential tackle. Well padded and with 3 internal and 2 external pockets for storage. The 2 padded internal sleeves will hold 6 sections in place with velcro securing straps, this holdall is ideal for the intrepid angler.<br>&nbsp;<br>Brand:&nbsp; <font color="#FF9936">NGT</font><br>Size: 86 x 19 x 8.5cm<br></font></p><font size="5"><font size="6"><br>1 x Dynamic Travel - 9ft, 4pc Carbon All Round <br></font><font size="6">Travel Rod</font><br><br>ONLY 75cm WHEN CLOSED<br>This one has to be seen to be believed.&nbsp; A <br>stunning all round, feature packed carbon travel rod!<br>This rod is versatile and can handle Many situation whether is be <br>stalking for carp or spinning. This really is <br>an all round wonder rod.... and a true pleasure to fish with!<br>&nbsp; Slim blank and butt end<br><br>&nbsp;Brand<br>NGT<br>&nbsp;Rod name<br>Dynamic Travel<br>&nbsp;Pieces<br>4 (4 sections)<br>&nbsp;Length ft / m<br>9ft / 2.7m<br>&nbsp;Closed length<br>75cm closed<br>&nbsp;Casting weight<br>20-50g<br>&nbsp;Material<br>Carbon<br>Colour<br>Grey carbon<br>&nbsp;Casing<br>Cloth bag<br><br><font size="6">6 x Hair Rigs 12lb Braid Barbless Size 6 8 10 </font><br><br>Quality Hair Rigs Tied On 12lb Braid<br>Suitable For 14-16mm Baits.<br>You will receive 18 x hair rigs in the following sizes<br>&nbsp; 2 x Size 6 Hooks.<br>&nbsp;2 x Size 8 Hooks.<br>2 x Size 10 Hooks.<br>&nbsp;All Hooks Are Barbless.<br>Rig Length Approx 8”. With A Size 8 Swivel<br><br><font size="6">4 x Ready Tied Chod Rigs</font><br><br>These Chod Rigs are made using 20lb Fluorocarbon and quality terminal <br>end tackle with super sharp hooks.<br>All chod rigs are perfectly made to give one of the most effective carp <br>catching presentations when using buoyant pop ups.<br>You Will Receive <br>1 x Size 6 Hook 3cm In Length<br>1 x Size 6 Hook 6cm In Length<br>1 x Size 8 Hook 3cm In Length<br>1 x Size 8 Hook 6cm In Length<br>All hooks are barbless and made with 20lb Fluorocarbon.<br></font><br><font size="5"><font size="6"><br>1 x EG60 2BB ''Carp Runner'' Reel With 10lb Line</font><br><br>A 2BB ''carp runner'' reel with 10lb line.<br>&nbsp;- S-Curve Oscillation System<br>- Graphite Spool<br>- Power Drive Gear Equipped For High Strength<br>- Coiled Bail Spring<br>- Right/ Left Inter-Changeable Handle<br>- Computer Balanced Rotor<br>- High Tensile Strength Plastic Body<br>- 30 Stop-Point System<br>- Gear Ratio - 5.2:1<br>&nbsp;Line Capacity<br>&nbsp;mm&nbsp;&nbsp;&nbsp;&nbsp; m&nbsp;&nbsp;&nbsp;&nbsp; lb&nbsp;&nbsp;&nbsp;&nbsp; yds<br>0.28&nbsp;&nbsp;&nbsp;&nbsp; 365&nbsp;&nbsp;&nbsp;&nbsp; 12&nbsp;&nbsp;&nbsp;&nbsp; 350<br>0.35&nbsp;&nbsp;&nbsp;&nbsp; 245&nbsp;&nbsp;&nbsp;&nbsp; 14&nbsp;&nbsp;&nbsp;&nbsp; 270<br>0.40&nbsp;&nbsp;&nbsp;&nbsp; 195&nbsp;&nbsp;&nbsp;&nbsp; 20&nbsp;&nbsp;&nbsp;&nbsp; 210<br>&nbsp;BRAND: NGT</font><br><p><font size="6"><font size="5"></font>1 x Pack of extender stops</font></p><p><font size="6">1 x Rod Rest</font></p><p><font size="6">1 x Bobbin</font></p><p><font size="6">2 x Black stainless steel banksticks</font></p><p><font size="6">1 x Bite alarm with tone and volume control</font></p><p><font size="6">1 x Pack of boilies (flavours vary)</font></p><p><font size="5"><font size="6">1 x pack of 9 pieces of NGT articifial baits. </font><br></font></p><p><font size="5"> This pack includes;&nbsp;&nbsp; <br>1 Large yellow floating sweetcorn<br>1 Large red floating sweetcorn<br>1 Small yellow floating sweetcorn<br>1 Small white floating sweetcorn<br>1 Large red sinking maggot<br>1 Large white sinking maggot<br>1 Small red sinking maggot<br>1 Small white sinking maggot<br>1 Floating bread flake</font></p><p><font size="6">1 x set of 4 baiting needles with rubber grips.<br></font><font size="5"><br>1 x DRILL<br>1 x STRINGER NEEDLE<br>1 x GATED BAITING NEEDLE<br>1 x BARBED BAITING NEEDLE</font><br><br><font size="6">2 x Weights</font></p><p><font size="6">1 x Set of 4 in-line method feeders (15, 20, 24 &amp; 30g) and soft touch moulding cap<br></font></p><p><br></p><p><img src="data:<;base64," alt=""></p><p><img src="data:<;base64," alt="" width="279" height="186"><br><br></p></td>
