<td height="97" valign="top" width="488"> 
<p><b><font size="3" face="Arial">Rolle:<font color="#000000"></font></font></b></p><b><font size="3" face="Arial"><font color="#000000" size="4"> 
<h1><font size="4">FOX<sup>®</sup><span class="Apple-converted-space">&nbsp;</span><i>Diablo</i><sup>®</sup><span class="Apple-converted-space">&nbsp;</span></font><font size="4">Reel 350S<br><font color="#0000ff" size="3">Wird in Amerika zum Tarpoon-Fischen Verkauft</font></font></h1> 
<h1><font size="4"><font color="#ff0000">Ladenpreis&nbsp;: 135 €</font></font></h1></font></font></b> 
<p><font size="2" face="Arial">Die Diablo Rolle ist ein hundertprozentiges Produkt für alle Arten von Spinnfischen auf kapitale Fische im Salz- oder Süßwasser. Entwickelt auf der Basis des Fox HDG Drive Train bewirken die fünf plus eins hochqualitativen Edelstahlkugellager eine ruckfreie Kraftübertragung zwischen Angler und Fisch. Bei dieser Serie wird ein einzigartiges Bremssystem (CDT) eingebaut. Hier spielen eine große Bremsscheibe aus hochwertiger Kohlefaser und speziell entwickelte Befeuchtung zusammen, um eine extrem stabile, leicht laufende Bremse zu erreichen.</font></p><font size="2"><b> 
<p><font face="Arial">MERKMALE:</font></p></b> 
</font><ul> 
<li><font size="2"><font face="Arial">Groß dimensioniertes Schnurlaufröllchen, dies reduziert den Schnurdrall massiv und ergibt eine bessere Handhabung der Schnur. </font> 
</font></li><li><font size="2"><font face="Arial">Groß dimensionierter Schnurfangbügel (OBA) für erhöhte Stabilität und eine bessere Handhabung der Schnur. </font> 
</font></li><li><font size="2"><font face="Arial">Braid Friendly Design (BFD), alle unsere Diablo Rollen sind für geflochtene Schnur geeignet. </font> 
</font></li><li><font size="2"><font face="Arial">Carbon Drag Technology (CDT), durch die Verwendung einer großen Bremsscheibe aus hochwertiger Kohlefas­er mit Kreuzwicklung erreichen wir ein in seiner Stärke tonangebendes Bremssystem, ohne das dies zu Lasten eines weichen ruckfreien Schnurabzuges ginge. </font> 
</font></li><li><font size="2"><font face="Arial">Dual Anti-Reverse (DAR), Unsere ruckfreie Bremse beginnt im Drill sofort zu arbeiten, aber wenn beim Drill des Lebens das Schlimmste passiert, greift immer noch die Rücklaufsperre als zweites System, sodass Sie nie die Kontrolle über den Fisch verlieren werden. </font> 
</font></li><li><font size="2"><font face="Arial">Heavy Duty Gear System, das reibungsarme Getriebe wurde mit der Zielrichtung Stärke entwickelt und gibt dem Angler die notwendige Kraft, aber auch die gewünschte Sensibilität. </font> 
</font></li><li><font size="2"><font face="Arial">Replaceable Slider System (RSS), dieses einzigartige, patentierte Merkmal ermöglicht den Austausch der reibungsarmen Gelenkstangen so bald und so oft Sie es wollen. Andere Rollen leiden nach einiger Zeit oft unter Unregelmäßigkeiten beim Drehen. Durch den Austausch der beiden Gelenkstangen in der Diablo wird diese wieder so gleichmäßig wie frisch aus der Packung laufen und Ihnen den unmittelbaren Einsatz der Bremse auch in Zukunft erhalten, auch die Gesamtlebensdauer der Rolle profitiert davon erheblich. </font> 
</font></li><li><font size="2"><font face="Arial">CNS System, das besondere Profil unseres CNS Systems bringt verbesserten Komfort, mehr Gefühl und eine unerreichte Kontrolle. </font> 
</font></li><li><font size="2"><font face="Arial">Corrosion Resistant Finish (CRF), durch eine Schutzschicht gegen Korrosion sieht Ihre Rolle auch nach intensivem Gebrauch noch gut aus und arbeitet störungsfrei. </font> 
</font></li><li><font face="Arial" size="2">Rotor Brake (RB), unser Schaltungssystem reduziert die Rotation des Rotors, die sonst die Gefahr birgt, den Schnurfangbügel schon während des Wurfes schließen zu lassen. Sie erreichen so maximale Wurfweiten, ohne Angst vor einem zur falschen Zeit zuschnappenden Schnurfangbügel haben zu müssen.</font></li></ul></td> 
<td height="811" width="642"> 
